INSERT INTO `dg_article` VALUES ('13', 'Starting over for 2016', 'starting-over-for-2016', '86', 'Starting over for 2016', 'Starting over for 2016', '', '<p>Its a new year! I have decided to start over with this blog since somehow everything I have written got deleted. It has been an amazing year for me. I have learned so much as a printer as well a business owner. The most important thing I have to say that I &Acirc;&nbsp;learned this year is starting over. I got kicked off google listing twice, website malfunctioning, reviews being deleted, dryers dying on me, and the list goes on..</p>\r\n<p>All it takes is getting back up when you fall and trying again. &Acirc;&nbsp;I am extremely blessed to experience everything I had in 2013 and I am eager to see what the new year holds in store for me. So 2014, I am ready to kick you in the face and bring the house down.</p>', '/media/assets/logo-150x150.jpg', '1', '2015-01-30 10:30:10', 'Teevision Printing', '34', '');
INSERT INTO `dg_article` VALUES ('14', '5 Pointz', 'class-aptent-taciti-sociosqu-ad-litora-torquent', '86', '5 Pointz', '5 Pointz', '5 Pointz', '<p>Yes, I am rewriting about this place since it is awesome. I&rsquo;m so glad I got the chance to see it before it was destroyed by the owner. This place was pretty much the mecca of graffiti out in long island city. I remember as soon as I parked I could hear the music on full blast at the heart of the buildings and you would see people on each wall creating their next master piece.</p>\r\n<p>What I loved the most was that when you looked around everyone came from all different backgrounds. It didn&rsquo;t matter what color you were or how old you were. The passion they had for this brought them all together whether they knew or not. Too bad it&rsquo;s all gone now and I won&rsquo;t ever see people tagging in broad daylight without the cops chasing you.&Acirc;&nbsp;I just wished I &Acirc;&nbsp;handed out business cards so I could of made them&nbsp;<a title=\"custom t-shirts\" href=\"http://teevisionprinting.com/\" target=\"_blank\">custom t-shirts</a>&nbsp;of their stuff. Oh wells. Enjoy the pictures</p>\r\n<p><img class=\"alignnone size-medium wp-image-2162\" src=\"http://teevisionprinting.com/wp-content/uploads/20130914_1423291-300x225.jpg\" alt=\"20130914_142329\" width=\"300\" height=\"225\" /><img class=\"alignnone size-medium wp-image-2163\" src=\"http://teevisionprinting.com/wp-content/uploads/20130914_1423331-300x225.jpg\" alt=\"20130914_142333\" width=\"300\" height=\"225\" /><img class=\"alignnone size-medium wp-image-2164\" src=\"http://teevisionprinting.com/wp-content/uploads/20130914_1425061-300x225.jpg\" alt=\"20130914_142506\" width=\"300\" height=\"225\" /><img class=\"alignnone size-medium wp-image-2165\" src=\"http://teevisionprinting.com/wp-content/uploads/20130914_1425291-300x225.jpg\" alt=\"20130914_142529\" width=\"300\" height=\"225\" /><img class=\"alignnone size-medium wp-image-2166\" src=\"http://teevisionprinting.com/wp-content/uploads/20130914_142737-300x225.jpg\" alt=\"20130914_142737\" width=\"300\" height=\"225\" /><img class=\"alignnone size-medium wp-image-2169\" src=\"http://teevisionprinting.com/wp-content/uploads/20130914_143412-300x225.jpg\" alt=\"20130914_143412\" width=\"300\" height=\"225\" /><img class=\"alignnone size-medium wp-image-2170\" src=\"http://teevisionprinting.com/wp-content/uploads/20130914_143418-300x225.jpg\" alt=\"20130914_143418\" width=\"300\" height=\"225\" /><img class=\"alignnone size-medium wp-image-2171\" src=\"http://teevisionprinting.com/wp-content/uploads/20130914_143523-300x225.jpg\" alt=\"20130914_143523\" width=\"300\" height=\"225\" /><img class=\"alignnone size-medium wp-image-2173\" src=\"http://teevisionprinting.com/wp-content/uploads/20130914_144058-300x225.jpg\" alt=\"20130914_144058\" width=\"300\" height=\"225\" /><img class=\"alignnone size-medium wp-image-2174\" src=\"http://teevisionprinting.com/wp-content/uploads/20130914_144416-300x225.jpg\" alt=\"20130914_144416\" width=\"300\" height=\"225\" /><img class=\"alignnone size-medium wp-image-2176\" src=\"http://teevisionprinting.com/wp-content/uploads/20130914_144800-300x225.jpg\" alt=\"20130914_144800\" width=\"300\" height=\"225\" /><img class=\"alignnone size-medium wp-image-2178\" src=\"http://teevisionprinting.com/wp-content/uploads/20130914_143009-225x300.jpg\" alt=\"20130914_143009\" width=\"225\" height=\"300\" /><img class=\"alignnone size-medium wp-image-2179\" src=\"http://teevisionprinting.com/wp-content/uploads/20130914_143943-225x300.jpg\" alt=\"20130914_143943\" width=\"225\" height=\"300\" /><img class=\"alignnone size-medium wp-image-2180\" src=\"http://teevisionprinting.com/wp-content/uploads/20130914_144446-225x300.jpg\" alt=\"20130914_144446\" width=\"225\" height=\"300\" /><img class=\"alignnone size-medium wp-image-2161\" src=\"http://teevisionprinting.com/wp-content/uploads/20130914_141713-225x300.jpg\" alt=\"20130914_141713\" width=\"225\" height=\"300\" /></p>', '/media/assets/20130914_1423291-300x225.jpg', '1', '2015-01-30 10:30:46', 'admin', '76', '');
INSERT INTO `dg_article` VALUES ('15', 'Past and Present', 'past-and-present', '85', 'Past and Present', 'Past and Present', 'Past and Present', '<div class=\"post-content\">\r\n<p>When I first started&nbsp;<a title=\"customer screen printing\" href=\"http://teevisionprinting.com/\" target=\"_blank\">custom screen printing</a>&nbsp;it was NOT easy. I think I researched on forums and and watched youtube videos more than I actually printed for several months. It didn&rsquo;t help that my first machine was probably 10x older than me. However, It was an awesome press. It was a 6/8 &Acirc;&nbsp;Hopkins international manual press and I learned everything I needed to on it. Custom T-shirt printing became an obsession for me, and even though everyday was a challenge, I couldn&rsquo;t wait to get into the shop and tackle on the next thing. It all started with this press.&nbsp;<img class=\"alignnone size-medium wp-image-2059\" src=\"http://teevisionprinting.com/wp-content/uploads/IMG_20130619_2248182-300x300.jpg\" alt=\"IMG_20130619_224818\" width=\"300\" height=\"300\" /><img class=\"alignnone size-medium wp-image-2307\" src=\"http://teevisionprinting.com/wp-content/uploads/20131119_101500-300x225.jpg\" alt=\"20131119_101500\" width=\"401\" height=\"301\" /></p>\r\n<p>I upgraded to something newer with micro registrations so that set-up would be much easier but I always remember from time to time what I started with. Here&rsquo;s a photo of my current setup before I put the auto together.&nbsp;</p>\r\n<div id=\"wpcr_respond_1\">&nbsp;</div>\r\n<div class=\"fix\">&nbsp;</div>\r\n</div>', 'media/assets/IMG_20130619_2248182-300x300.jpg', '1', '2015-03-09 21:33:34', 'Teevision Printing', '39', '');
INSERT INTO `dg_article` VALUES ('16', 'test city', 'test-city', '90', '', '', '', '<p>Qu&aacute; tr&igrave;nh xử l&yacute;, nhiều t&agrave;i xế biển số xanh năn&nbsp;nỉ kh&ocirc;ng được, gọi điện nhờ can thiệp nhưng vẫn&nbsp;bị xử l&yacute;.</p>\r\n<p>Tr&ecirc;n trục đường Nguyễn Huệ gần cổng UBND TP.HCM, đo&agrave;n kiểm tra ph&aacute;t hiện nhiều xe biển xanh đậu tr&ecirc;n lề đường sai quy định n&ecirc;n tiến h&agrave;nh lập bi&ecirc;n bản vi phạm, trong đ&oacute; c&oacute; nhiều xe chở l&atilde;nh đạo c&aacute;c sở ng&agrave;nh, quận huyện về họp ở UBND TP.HCM.</p>\r\n<p>Khi đo&agrave;n kiểm tra lập bi&ecirc;n bản, nhiều t&agrave;i xế thanh minh do được nh&acirc;n vi&ecirc;n thanh ni&ecirc;n xung phong hướng dẫn đậu xe n&ecirc;n kh&ocirc;ng biết vi phạm v&agrave; mong được bỏ qua.</p>', '/media/assets/arizona.jpg', '1', '2017-02-22 16:59:12', '', '14', '');
INSERT INTO `dg_article` VALUES ('17', 'etef', 'df', '90', '', '', '', '<p>Khi lực lượng chức năng y&ecirc;u cầu &ocirc;ng Vinh xuất tr&igrave;nh giấy tờ xe, &ocirc;ng Nguyễn Văn Th&agrave;nh, Ph&oacute; Chủ tịch UBND Q.9 xuất hiện v&agrave; đề nghị được đo&agrave;n kiểm tra &ldquo;bỏ qua cho lần đầu&rdquo;.</p>\r\n<p>Sau đ&oacute;, &ocirc;ng Th&agrave;nh c&oacute; gọi điện người quen nhờ can thiệp nhưng &ocirc;ng Đo&agrave;n Ngọc Hải, trưởng đo&agrave;n kiểm tra từ chối, y&ecirc;u cầu lập bi&ecirc;n bản, xử l&yacute; theo quy định.</p>', 'media/assets/arizona.jpg', '1', '2017-02-22 18:11:05', '', '0', '');
